import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <>
      <header>
        <h1 class="app name">ArtisticAlly</h1>
        <button class="reg-page button">Home</button>
        <hr></hr>
      </header>
      <main>
        <button class="reg-page button"> Get Started! </button>

      </main>
    </>

  );
}

export default App;
